import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
  const Hello = () => {
    return (
      <div>
        <p>Hello world</p>
      </div>
    )
  }

  const App = () => {
    return (
      <div>
        <h1>Greetings</h1>
        <Hello />
        <Hello />
        <Hello />
      </div>
    )
  }
}



export default App;
